const StarMap = ({ width = 500, height = 500 }) => {
  return (
    <svg
      stroke="lightGrey"
      fill="lightGrey"
      style={{ borderWidth: 2, borderColor: 'green' }}
    >
      <circle cx="50" cy="50" r="40" />
      <circle cx="150" cy="50" r="4" />

      <svg viewBox="0 0 10 10" x="200" width="100">
        <circle cx="5" cy="5" r="4" />
      </svg>
    </svg>
  );
};

export default StarMap;
